import React from "react";
import { pageLinks } from "../dafa";

function PageLinks() {
  return (
    <ul className="nav-list">
      <li>
        <a href="#home" className="nav-link">
          <i className="fa-solid fa-house"></i>Home
        </a>
      </li>
    </ul>
  );
}

export default PageLinks;
